const alphabet = ['a', 'b', 'c', 'd', 'e', 'f', 'g', 'h', 'i', 'j', 'k', 'l', 'm', 'n', 'o', 'p', 'q', 'r', 's', 't', 'u', 'v', 'w', 'x', 'y', 'z'];

function day05(input) {
    input = input.split('');
    let startIndex = 0;

    let isChanged = true;
    while (isChanged) {
        isChanged = false;

        let i = startIndex;
        test:
        while (i < input.length - 1) {
            if (lettersSameAndDiffCase(input[i], input[i + 1])) {
                input.splice(i, 2);
                isChanged = true;
                startIndex = i - 1;
                break test;
            } else {
                i++;
            }
        }
    }

    return (input.join('').length);
}

function day05Two(input) {
    input = input.split('');
    let shortestLength = (Infinity);
    

    for (let j = 0; j < alphabet.length; j++) {
        let currArr = [...input];
        const a = alphabet[j];
        const b = alphabet[j].toUpperCase();

        currArr = currArr.filter(item => item != a);
        currArr = currArr.filter(item => item != b);

        currArr = currArr.join('');
        let currLength = day05(currArr);
        
        if (currLength < shortestLength) {
            shortestLength = currLength;
        }
    }

    return shortestLength;
}

function lettersSameAndDiffCase(a, b) {
    if (a.toLowerCase() != b.toLowerCase()) {
        return false;
    }
    if ((a == a.toLowerCase() && b == b.toUpperCase()) ||
        (b == b.toLowerCase() && a == a.toUpperCase())) {
            return true;
    }
    return false;
}

console.log(`Part one's answer is: ${day05(day05Arr)}`);
